paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 2 ? 2 : (v < -4 ? -4 : v));
            return v;
        }
    case 1:
        {
            v = (v > 127 ? 127 : (v < 0 ? 0 : v));
            return v;
        }
    case 2:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 3:
        {
            v = (v > 15 ? 15 : (v < 0 ? 0 : v));
            return v;
        }
    case 4:
        {
            v = (v > 66150 ? 66150 : (v < 16537 ? 16537 : v));
            return v;
        }
    case 5:
        {
            v = (v > 6 ? 6 : (v < 0 ? 0 : v));

            {
                const oneStep = 6 / 6;
                const oneStepInv = (oneStep != 0 ? 1 / oneStep : 0);
                const numberOfSteps = rnbo_fround(v * oneStepInv * 1 / 1) * 1;
                v = numberOfSteps * oneStep;
            }

            return v;
        }
    case 6:
        {
            v = (v > 100 ? 100 : (v < 0 ? 0 : v));

            {
                const oneStep = 100 / 100;
                const oneStepInv = (oneStep != 0 ? 1 / oneStep : 0);
                const numberOfSteps = rnbo_fround(v * oneStepInv * 1 / 1) * 1;
                v = numberOfSteps * oneStep;
            }

            return v;
        }
    default:
        return value;
    }
}
